def RGB(T):
	Rt = R(T)
	Gt = G(T)

	if len(Rt) < 2:
		Rt = '0' + str(Rt) 

	if len(Gt) < 2:
		Gt = '0' + str(Gt) 
	return ('#' + str(Gt) + '00' + '00')

def R(T):
	return hex(255)[2:]

def G(T):
	G = (255/200)*(T-100)

	if G < 0:
		G = 0

	if G > 255:
		G = 255

	return hex(floor(G))[2:]

def B(T):
	B = (255/100)*(T-200)

	if B < 0:
		B = 0;


	return hex(floor(B))[2:]



